CREATE TABLE rounds (
	match_id INTEGER NOT NULL,
	round_num INTEGER NOT NULL,
	timestamp DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL,
	team_data TEXT DEFAULT NULL,
	enemy_match_id INTEGER NOT NULL,
	won BOOLEAN DEFAULT NULL,
	FOREIGN KEY (enemy_match_id, round_num) REFERENCES rounds (match_id, round_num),
	FOREIGN KEY (match_id) REFERENCES matches (match_id)
	PRIMARY KEY (match_id, round_num)
);

CREATE TABLE matches (
	match_id INTEGER NOT NULL,
	steam_id INTEGER NOT NULL,
	FOREIGN KEY (steam_id) REFERENCES players (steam_id),
	PRIMARY KEY (match_id AUTOINCREMENT)
);

CREATE TABLE players (
	steam_id INTEGER NOT NULL,
	resume_data TEXT,
	PRIMARY KEY (steam_id)
);

